//SAO_menu
(function($) {
    var SAO_Launcher = $("#SAO_Launcher")[0];
    var SAO_Dismiss = $("#SAO_Dismiss")[0];
    var SAO_Click = $("#SAO_Click")[0];
    var IsDouble = false;
    var SAOMenu = {
        init: function(options) {
             $(".ok_button").click(function(){
                SAO_Click.play();

                 setTimeout(function(){
                    window.location.href="http://todaylg.com/";
                },500);
            })
            $(".cancle_button").click(function(){
                $("#SAO_Menu").removeClass("open");
                $("#SAO_Menu").css("visibility","hidden");
                SAO_Launcher.pause();
                SAO_Launcher.currentTime = 0;
                SAO_Dismiss.play();
                IsDouble=!IsDouble;
            })
                $menu = $('#' + options.menu);
                $(window).on('contextmenu',
                function(e) {
                    e.preventDefault();
                    e.stopPropagation();
                })
                $(window).on('mousedown',
                function(e) {
                if (e.which === 3) {
                    if(!IsDouble){
                        SAOMenu.getCoords(e);
                        IsDouble = true;
                    }else{
                        IsDouble = false;
                    }
                    transform_number = 100;
                    var top = Coords.clientY+transform_number,
                    left = 
                    ($('body')[0] === e.target) ? Coords.clickX:
                    Coords.clientX;
                    var bodyHe= document.documentElement.clientHeight;
                    var bodyWi = document.documentElement.clientWidth;
                    if(top<0) top=0;
                    if(bodyHe-Coords.clientY<350) top=bodyHe-250;
                    if(left<0) left=0;
                    if($('body')[0] === e.target){if(bodyWi-Coords.clickX<380) left=bodyWi-380} else {//拓展性
                        if(bodyWi-Coords.clientX<380) left=bodyWi-380
                    };
                    $menu.css({
                        top: top + 'px',
                        left: left + 'px'
                    });
                    if ($("#SAO_Menu").hasClass("open")) {
                        $("#SAO_Menu").removeClass("open");
                        $("#SAO_Menu").css("visibility","hidden");
                        SAO_Launcher.pause();
                        SAO_Launcher.currentTime = 0;
                        SAO_Dismiss.play();
                    } else {
                        $("#SAO_Menu").css("visibility","visible");
                        $("#SAO_Menu").addClass('open');
                        SAO_Dismiss.pause();
                        SAO_Dismiss.currentTime = 0;
                        SAO_Launcher.play();
                    }
                }
            })
        },
        getCoords: function(e) {
            var evt = e ? e: window.event;
            var clickX = 0,
                clickY = 0;
            if ((evt.clientX || evt.clientY) && document.body && document.body.scrollLeft != null) {
                
                clickX = evt.clientX + document.body.scrollLeft;
                clickY = evt.clientY + document.body.scrollTop;
            };
          
            if ((evt.clientX || evt.clientY) && document.compatMode == 'CSS1Compat' && document.documentElement && document.documentElement.scrollLeft != null) {
                clickX = evt.clientX + document.documentElement.scrollLeft;
                clickY = evt.clientY + document.documentElement.scrollTop;
            };
            if (evt.pageX || evt.pageY) {
                clickX = evt.pageX;
                clickY = evt.pageY;
            };
            return Coords = {
                clickX: clickX,
                clickY: clickY,
                clientX: evt.clientX,
                clientY: evt.clientY,
                screenX: evt.screenX,
                screenY: evt.screenY
            }
        }
    };
    $.fn.SAO_Menu = function(options) {
     if (typeof options === 'object' || !options) {
            return SAOMenu.init(options)
        } else {
            $.error('Method ' + method + ' does not exist')
        }
    }
})(jQuery);